import React from "react";
import {
  FaHtml5, FaCss3Alt, FaJs, FaPython, FaJava, FaReact, FaNodeJs,
  FaAws, FaGitAlt, FaGithub, FaAndroid, FaFigma, FaPalette,
  FaEnvelopeOpenText, FaServer, FaCode, FaDashcube
} from "react-icons/fa";

import {
  SiExpress, SiMongodb, SiPostman, SiCanva, SiDart,
  SiNumpy, SiPandas, SiTensorflow, SiMysql, SiJavascript
} from "react-icons/si";

import { TbBrain, TbLanguage } from "react-icons/tb";
import { AiOutlineEye } from "react-icons/ai";

const skills = [
  { name: "HTML", icon: <FaHtml5 /> },
  { name: "CSS", icon: <FaCss3Alt /> },
  { name: "JavaScript", icon: <FaJs /> },
  { name: "React", icon: <FaReact /> },
  { name: "Node.js", icon: <FaNodeJs /> },
  { name: "Express.js", icon: <SiExpress /> },
  { name: "MongoDB", icon: <SiMongodb /> },
  { name: "Python", icon: <FaPython /> },
  { name: "Java", icon: <FaJava /> },
  { name: "MySQL", icon: <SiMysql /> },
  { name: "Postman", icon: <SiPostman /> },
  { name: "AWS", icon: <FaAws /> },
  { name: "Git", icon: <FaGitAlt /> },
  { name: "GitHub", icon: <FaGithub /> },
  { name: "VS Code", icon: <FaCode /> },
  { name: "Android", icon: <FaAndroid /> },
  { name: "Figma", icon: <FaFigma /> },
  { name: "Canva", icon: <SiCanva /> },
  { name: "Dart", icon: <SiDart /> },
  { name: "NumPy", icon: <SiNumpy /> },
  { name: "Pandas", icon: <SiPandas /> },
  { name: "TensorFlow", icon: <SiTensorflow /> },
  { name: "Machine Learning", icon: <TbBrain /> },
  { name: "Deep Learning", icon: <FaServer /> },
  { name: "Vision", icon: <AiOutlineEye /> },
  { name: "Languages", icon: <TbLanguage /> }
];

export default function Skills() {
  return (
    <section id="skills" className="skills-section" style={{ padding: "2rem 1rem", textAlign: "center" }}>
      <h2 className="section-title" style={{ fontSize: "2rem", fontWeight: "bold", marginBottom: "2rem" }}>
        Technical Skills
      </h2>
      <div className="skills-grid" style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(100px, 1fr))",
        gap: "1.5rem",
        justifyItems: "center"
      }}>
        {skills.map((skill, index) => (
          <div key={index} className="skill-card" style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            padding: "1rem",
            backgroundColor: "#1f2937",
            borderRadius: "0.5rem",
            color: "#fff"
          }}>
            <div className="skill-icon" style={{ fontSize: "2rem", marginBottom: "0.5rem" }}>
              {skill.icon}
            </div>
            <div className="skill-name" style={{ fontSize: "0.9rem" }}>{skill.name}</div>
          </div>
        ))}
      </div>
    </section>
  );
}
